window.bookSummaryJSON = "<p><b>Having survived the events at the Invader encampment, Vic finds and exposes even more corruption and conspiracies in his own city. </b></p> <p>As an operative of the United Forces of Humanity and its secret covert group known as the Knight Hunters, we join Vic as he digs even deeper into the underbelly of humanity's survival. In doing so, he uncovers even more nefarious activities that go beyond the horrors he's already unearthed. And as always, the threat from the Invaders is a constant risk that could end everything he holds dear.</p>"; 
